import React from 'react';
import { bindActionCreators } from 'redux'
import Header from '../../components/Menu';
import { connect } from 'react-redux'
import { list } from '../../redux/ListReducer'
import { makeStyles } from '@material-ui/core/styles';
import clsx from 'clsx';
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardContent from '@material-ui/core/CardContent';
import IconButton from '@material-ui/core/IconButton';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import { ListCard, Desc } from './styles';


const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: '15rem',
    display: 'inline-block',
    verticalAlign: 'text-top',
  },
  media: {
    aspectRatio: 1
  },
  expand: {
    transform: 'rotate(0deg)',
    marginLeft: 'auto',
    transition: theme.transitions.create('transform', {
      duration: theme.transitions.duration.shortest,
    }),
  },
  expandOpen: {
    transform: 'rotate(180deg)',
  },
}));

function Home(props) {
  const classes = useStyles();


  React.useEffect(() => {
    props.list();
  }, [])
  return (
    <>
      <Header />
      <ListCard>
        {
          props.lista ?
            props.lista.map(lista => (

              <Card className={classes.root}>
                <CardHeader
                  action={
                    <IconButton aria-label="settings">
                      <MoreVertIcon />
                    </IconButton>
                  }
                />
                <img src={lista.image_url}
                  style={{ height: 100 }}
                  alt={lista.nome}
                />
                <CardContent>
                  <Desc variant="body2" color="textSecondary" component="p">
                    {lista.name}
                  </Desc>
                  <Desc variant="body2" color="textSecondary" component="p">
                    {lista.description}
                  </Desc>
                </CardContent>
              </Card>


            )) : ''}
      </ListCard>

    </>
  )
}

const mapStateToProps = state => ({
  lista: state.list.list,

})


const mapDispatchToProps = dispatch =>
  bindActionCreators({ list }, dispatch)

export default connect(mapStateToProps, mapDispatchToProps)(Home);
